import React from 'react';
import { Container, Typography, TextField, Button, Box } from '@mui/material';

function LoginSignup() {
  return (
    <Container maxWidth="sm" id="login" sx={{ paddingY: 5 }}>
      <Box sx={{ backgroundColor: '#ffffff', padding: 4, borderRadius: 2, boxShadow: '0 4px 12px rgba(0, 0, 0, 0.1)' }}>
        <Typography variant="h5" sx={{ textAlign: 'center', color: '#00522D', fontWeight: 'bold', marginBottom: 3 }}>
          Log In or Create an Account
        </Typography>
        <TextField label="Email" variant="outlined" fullWidth margin="normal" sx={{ marginBottom: 3 }} />
        <TextField label="Password" type="password" variant="outlined" fullWidth margin="normal" sx={{ marginBottom: 3 }} />
        <Button variant="contained" fullWidth sx={{ backgroundColor: '#1e88e5', marginBottom: 2 }}>
          Log In
        </Button>
        <Button variant="outlined" fullWidth sx={{ borderColor: '#00522D', color: '#00522D' }}>
          Create Account
        </Button>
      </Box>
    </Container>
  );
}

export default LoginSignup;
